	add("lifestream", "{\"term\":\"lifestream\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|life|stream|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"According to certain New Age beliefs, a stream of life force associated with an individual being\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027Yoga Journal\u0027 (number 12, January 1977, page 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"These planetary chakras, also called retreats, are places where the rays of cosmic energies are focused on Earth to sustain the evolving \u0027\u0027lifestreams\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Roza Riaikkenen, Margarita Riaikkenen, \u0027The Laws of Life\u0027 (page 239\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Only the spiritual path with all its experiences and lessons leads to balancing it. His current incarnation is a part of his \u0027\u0027lifestream\u0027\u0027, and he has to pass the individual way of his lifestream\u0027s development through many incarnations\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Michael Bertiaux, \u0027The Voudon Gnostic Workbook: Expanded Edition\u0027 (page 198\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The student must be aware of his \u0027\u0027lifestream\u0027\u0027 and field of vital energy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A time-ordered stream of documents that functions as a diary of one\u0027s electronic life\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, John P. Girard, JoAnn L. Girard, \u0027Social Knowledge\u0027 (page 35\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"These tools include blogs, message boards, podcasts, micro blogs, \u0027\u0027lifestreams\u0027\u0027, bookmarks, networks, communities, wikis, and vlogs\", \"priority\":10}]}, \"synonyms\":{}}");

